import "./Testing.css";
import {
  CheckCircle,
  DoNotDisturb
} from "@mui/icons-material";
export default function Testing() {
const initialValues = {
	Application_Title: ''
}
const SoftwareSDK = [
    {
        name: 'UbuntuLinux',
        TestStatus: 1 ,
    },
    {
        name: 'Pony',
        TestStatus: 0,
    },
];
const Softwares = () => {
    var tables = {}
    for(const object in SoftwareSDK) {
    for(const value in object){
        console.log(value)
        if(value === 'TestStatus'){
            if(SoftwareSDK[value] === 0){
                tables[value] = SoftwareSDK.map(s => (
                 <li key={s.name}>
                    <h2 className="soft">{s.name}
                        <CheckCircle className="StatusIcon">
                        </CheckCircle>
                    </h2>
                </li>
            ));
            return tables
            }
            else if(SoftwareSDK[value] === 1){
                const tables = SoftwareSDK.map(s => (
                 <li key={s.name}>
                    <h2 className="soft">{s.name}
                        <DoNotDisturb className="StatusIcon">
                        </DoNotDisturb>
                    </h2>
                </li>

            ));
            return tables
            }
        }
    }
    }
}
const WordList = () => (
    <ul className="SoftwareList">
        <Softwares/>
    </ul>
);

  return (
    <div className="testing">
       <>
			<div className="Application_Software">
			    <h3 className="Application">Project Figure what to put on the bottom of my hayride jug</h3>
			    <div className="Software">
                    <h2 className="soft">Software
                        <CheckCircle className="StatusIcon">
                        </CheckCircle>
                    </h2>
                    <WordList/>
                </div>

			</div>
	    </>
    </div>
  );
}
